    [],nt"num_tags": 5,nt"name": "narrative-report-may-june-and-july-1939-tule-lake-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments from May through July of 1939. The
    report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    predators, rodents, reptiles, and disease- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, and collections
    and receipts. Resource management is outlined; topics include grazing. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses and Refuge visitors.
    Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
